import React from 'react';

const Home = () => { 
    return( 
        <div className='container vh-100 vw-100 d-flex justify-content-center align-items-center'> 
            <button type='button' className='btn btn-primary rounded-pill'>Admin</button>
            <button type='button' className='btn btn-primary rounded-pill'>Client</button>
        </div> 
    ); 
}

export default Home;
